import React from 'react'
import { Box } from '@mui/system';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";

import Home from "./pages/Home";
const Top = () => {
  return (
    <div>
        <Box component="section" sx={{ p: 5,marginBottom: '20px', border: '1px dashed grey',}}>
            <div>
            <Router>
              <Routes>
                <Link to="/home">Test</Link>
                <Route path="/" element={<Home/>}/>
              </Routes>
            </Router>

            </div>
        </Box>
    </div>
  )
}

export default Top
